INSERT INTO `test` (`id`, `header`, `dataTest`, `image`, `checkedTheory`, `idCategory`) VALUES
(1, 'Булевые функции', 'question|1|Что такое булева функция?|False| \r\nao|Функция, принимающая булевые значения и возвращающая булевый результат.|True\r\nao|Функция, принимающая числа и возвращающая булевый результат.|False\r\nao|Функция, принимающая строки и возвращающая булевый результат.|False\r\nao|Функция, принимающая символы и возвращающая булевый результат.|False\r\nquestion|2|Каково количество возможных комбинаций значений для двух булевых переменных?|False| \r\nao|1|False\r\nao|2|False\r\nao|3|False\r\nao|4|True\r\nquestion|3|Что такое таблица истинности?|False| \r\nao|Таблица, отображающая все возможные комбинации значений входных переменных и результаты булевой функции.|True\r\nao|Таблица, отображающая только одну комбинацию значений входных переменных и результат булевой функции.|False\r\nao|Таблица, отображающая только результаты булевой функции без указания входных переменных.|False\r\nao|Таблица, отображающая только значения входных переменных без указания результатов булевой функции.|False\r\nquestion|4|Какие основные операции можно выполнять с булевыми функциями?|False| \r\nao|И, ИЛИ, НЕ|True\r\nao|Сложение, вычитание, умножение|False\r\nao|Деление, возведение в степень, извлечение корня|False\r\nao|Сравнение, сортировка, поиск|False\r\nquestion|5|Какие свойства имеют булевы функции?|False| \r\nao|Ассоциативность, коммутативность, дистрибутивность|False\r\nao|Линейность, непрерывность, дифференцируемость|False\r\nao|Симметричность, транзитивность, рефлексивность|False\r\nao|Монотонность, инвариантность, уникальность|False\r\n', , '1', 1);
