(5, 'Логический оператор И', 'question|1|Что такое логическое И?|False| \r\nao|Операция, возвращающая true всегда, независимо от значений операндов.|False\r\nao|Операция, возвращающая true только если оба операнда равны false.|False\r\nao|Операция, возвращающая true только если один из операндов равен true.|False\r\nao|Операция, возвращающая true только если оба операнда равны true.|True\r\nquestion|2|Какова таблица истинности для операции И?|False| \r\nao|true true - false, true false - true, false true - true, false false - true|False\r\nao|true true - false, true false - true, false true - false, false false - false|False\r\nao|true true - true, true false - false, false true - true, false false - false|True\r\nao|true true - true, true false - false, false true - false, false false - true|False\r\nquestion|3|Что произойдет, если один из операндов операции И равен false?|False| \r\nao|Результат будет равен true.|False\r\nao|Результат будет равен false.|True\r\nao|Результат будет зависеть от значений других операндов.|False\r\nao|Операция И нельзя выполнять, если один из операндов равен false.|False\r\nquestion|4|Каков результат операции И, если оба операнда равны true?|False| \r\nao|Результат будет равен true.|True\r\nao|Результат будет равен false.|False\r\nao|Результат будет зависеть от значений других операндов.|False\r\nao|Операция И невозможна, если оба операнда равны true.|False\r\nquestion|5|Приведите пример использования операции И в булевых функциях.|False| \r\nao|Проверка, является ли значение переменной равным нулю и истинным.|False\r\nao|Проверка, является ли строка пустой и состоящей только из пробелов.|False\r\nao|Проверка, является ли символ буквой и цифрой одновременно.|False\r\nao|Проверка, является ли число четным и положительным.|True\r\n', , '1,2', 2);

