INSERT INTO `theory` (`id`, `header`, `content`, `image`, `idCategory`) VALUES
(1, 'Булевы функции и их основные свойства.', 'Булева функция - это функция, которая принимает одно или несколько булевых (логических) значений и возвращает одно булевое значение. Булевы функции могут быть представлены с помощью таблиц истинности, где для каждого возможного набора входных значений указывается соответствующее выходное значение.\r\n\r\nОсновные свойства булевых функций:\r\n\r\n1. Инвариантность относительно перестановки переменных: значение булевой функции не изменится при перестановке переменных.\r\n\r\n2. Инвариантность относительно дополнения переменных: значение булевой функции не изменится при замене переменной на её дополнение (инверсию).\r\n\r\n3. Монотонность: если для всех переменных функции значение увеличивается, то и значение функции увеличивается.\r\n\r\n4. Самодвойственность: булева функция равна своему дополнению при инвертировании всех её переменных.\r\n\r\n5. Полиномиальное представление: любую булеву функцию можно представить в виде полинома над полем GF(2) (поле Галуа с двумя элементами).\r\n\r\nЭти свойства позволяют удобно анализировать и работать с булевыми функциями, что делает их важными в различных областях, таких как криптография, цифровая логика и информационная безопасность.', , 1),
(2, 'Операция логического И.', 'Логическое И (AND) - это булева операция, которая принимает два булевых значения и возвращает true (истина) только в том случае, если оба входных значения равны true. В противном случае, операция возвращает false (ложь). Например, если у нас есть две переменные A и B, то операция A AND B вернет true только в том случае, если и A и B равны true.', , 2);
INSERT INTO `theory` (`id`, `header`, `content`, `image`, `idCategory`) VALUES
(3, 'Операция логического ИЛИ.', 'Логическое ИЛИ - это операция, которая возвращает истинное значение, если хотя бы одно из условий истинно. В логике и программировании оператор ИЛИ обозначается символом \"||\". Например, выражение \"A || B\" будет истинным, если A истинно, B истинно или оба условия истинны.', , 2);
INSERT INTO `theory` (`id`, `header`, `content`, `image`, `idCategory`) VALUES
(4, 'Операция логического НЕ.', 'Логическое НЕ - это операция, которая инвертирует значение выражения. Если исходное выражение истинно, то после применения операции НЕ оно становится ложным, и наоборот. В логике и программировании оператор НЕ обозначается символом \"!\" или \"¬\". Например, выражение \"!A\" будет истинным, если A ложно, и наоборот.', , 2);
INSERT INTO `theory` (`id`, `header`, `content`, `image`, `idCategory`) VALUES
(5, 'Операция логического Исключающее ИЛИ.', 'Логическое Исключающее ИЛИ (XOR) - это операция, которая возвращает истину только в том случае, если одно из исходных выражений истинно, а другое ложно. Если оба выражения истинны или оба ложны, то результат операции XOR будет ложным. В логике и программировании оператор XOR обозначается символом \"^\" или \"⊕\". Например, выражение \"A ^ B\" будет истинным только в случае, если A истинно, а B ложно, или наоборот.', , 2);

